INSERT INTO `wp_comments` VALUES('771', '2222', 'podwyższony cholesterol', 'kiaracurtin@gmail.com', 'http://podwyzszony-cholesterol.pl', '79.133.217.242', '2015-03-21 09:38:37', '2015-03-21 15:38:37', 'Czym tak naprawdę jest cholesterol?\r\n\r\nCholesterol istnieje tak naprawdę niezbytecznym komponentem komórki \r\nnaszego organizmu. Jest niezastąpionym budulcem cel natomiast hormonów.\r\nCholesterol częściowo wstaje w polskim tworze — w wątrobie,\r\nnatomiast częściowo czerpie z pokarmu, jaki na co dzień \r\nspożywamy. Z przyród onymi jest więc niczym gniewnym.\r\n\r\n\r\nTo co jest złe, to jego nadmiar. A szczegółowiej materia ujmując nadmiar \"podstępnego cholesterolu\" rodzaju LDL.\r\nPrzyjmuje się, iż jego stężenie we juch oną winny \r\nnaruszać 100 mg/dl. Z pozostałej stron mam \"włoœci cholesterol\" wariantu HDL,\r\njakiego stężenie panu powinna transcendować 50 mg/dl obok białogłowy i 40 mg/dl \r\nu mężczyzn. Całkowite stężenie cholesterolu w polskiej posok \r\npowinnom mieścić się w przedziale 114-200 mg/dl. \r\n\r\nJednak jeżeli te zasady zostają wyprzedzone oraz ów poziom twierdzi się przez dłuższy \r\nokres, to zdołasz spodziewać się namaszczonych pasztetów.\r\n\r\n\r\nDlatego onego honoruj do takiego poziomu — popieraj cholesterol na \r\nwłaściwym poziomie.', '0', 'spam', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Maxthon/4.4.3.4000 Chrome/30.0.1599.101 Safari/537.36', '', '0', '0');
INSERT INTO `wp_comments` VALUES('772', '99', 'seo plugin', 'mssslzpxikc@gmail.com', 'http://www.WhiteHatSeoRankings.com/', '183.207.224.51', '2015-03-22 05:50:00', '2015-03-22 11:50:00', 'Hello Web Admin, I noticed that your On-Page SEO is is missing a few factors, for one you do not use all three H tags in your post, also I notice that you are not using bold or italics properly in your SEO optimization. On-Page SEO means more now than ever since the new Google update: Panda. No longer are backlinks and simply pinging or sending out a RSS feed the key to getting Google PageRank or Alexa Rankings, You now NEED On-Page SEO. So what is good On-Page SEO?First your keyword must appear in the title.Then it must appear in the URL.You have to optimize your keyword and make sure that it has a nice keyword density of 3-5% in your article with relevant LSI (Latent Semantic Indexing). Then you should spread all H1,H2,H3 tags in your article.Your Keyword should appear in your first paragraph and in the last sentence of the page. You should have relevant usage of Bold and italics of your keyword.There should be one internal link to a page on your blog and you should have one image with an alt tag that has your keyword....wait there\'s even more Now what if i told you there was a simple Wordpress plugin that does all the On-Page SEO, and automatically for you? That\'s right AUTOMATICALLY, just watch this 4minute video for more information at. <a href=\"http://www.WhiteHatSeoRankings.com\" rel=\"nofollow\">Seo Plugin</a>', '0', 'spam', 'Mozilla/4.0 (compatible; MSIE 6.0; Windows NT 5.1; SV1; Mozilla/4.0 (compatible; MSIE 6.0; Windows NT 5.1; SV1) ; .NET CLR 2.0.50727 ; .NET CLR 4.0.30319)', '', '0', '0');
